ownedComment.body:
This parameter, when used in the request,
(in) identifies a list of TPs with associated parameters to be applied; the parameter may be used by the requesting OS to determine the number of server layer CTPs to create for the specified FTP; an empty list means that the number of server layer CTPs is determined by the target OS;
(out) identifies the list of TPs with associated applied parameters.

